import React from "react";
import styled from "styled-components";
import Header from "../Common/Header/Header";
import NavHeader from "../Common/Header/NavHeader/NavHeader";
import Layouts from "../Common/Layout";
import SignupForm from "../components/Signup/SignupForm";
import { Input } from "../components/Input";

export default function SignUp() {
  return (
    //     <>
    //       <Header />
    //       <NavHeader />
    //       <Layouts>
    //         <JoinTitle>회원가입</JoinTitle>
    //         <JoinBody>
    //           <RequirementInfo>
    //             <span>*</span> 필수입력사항
    //           </RequirementInfo>
    //           <SignupForm></SignupForm>
    //         </JoinBody>
    //       </Layouts>
    //     </>
    //   );
    // }

    // const JoinTitle = styled.div`
    //   /* margin: 50px 0; */
    //   font-size: 28px;
    //   line-height: 35px;
    //   font-weight: 500;
    //   text-align: center;
    //   letter-spacing: -1px;
    //   color: #333;
    // `;
    // const JoinBody = styled.div`
    //   width: 640px;
    //   margin: 0 auto;
    // `;
    // const RequirementInfo = styled.div`
    //   padding-bottom: 10px;
    //   border-bottom: 2px solid rgb(51, 51, 51);
    //   font-size: 12px;
    //   color: rgb(102, 102, 102);
    //   line-height: 17px;
    //   text-align: right;

    //   & span {
    //     color: #ee6a7b;
    //   }
    // `;

    <>
      <Header />
      <NavHeader />
      <Layouts>
        <Container>
          <Title>로그인</Title>
          <Body>
            <form>
              <InputArea>
                <InputWrapper>
                  <Input
                    height="54px"
                    fontSize="14px"
                    placeholder="아이디를 입력해주세요"
                    type="text"
                    name="userId"
                  />
                </InputWrapper>
                <InputWrapper>
                  <InputWrapper
                    height="54px"
                    fontSize="14px"
                    placeholder="비밀번호를 입력해주세요"
                    type="password"
                    name="password"
                  />
                </InputWrapper>
              </InputArea>
              <FindUserInfoArea>
                <p>아이디 찾기</p>
                <span></span>
                <p>비밀번호 찾기</p>
              </FindUserInfoArea>
              <BtnWrapper>
                <Btn
                  type="submit"
                  width="100%"
                  height="54px"
                  border="0px none"
                  backgroundColor="#efefef"
                  color="rgb(51, 51, 51)"
                  fontSize="16px"
                  // onClick={onClickConfirmButton}
                >
                  로그인
                </Btn>
                <div style={{ height: "10px" }}></div>
                <Btn
                  type="button"
                  width="100%"
                  height="54px"
                  fontSize="16px"
                  // onClick={() => nav("/signup")}
                >
                  회원가입
                </Btn>
              </BtnWrapper>
            </form>
          </Body>
        </Container>
      </Layouts>
    </>
  );
}

const Container = styled.div`
  min-width: 1050px;
  margin-top: 90px;
  margin-bottom: 60px;
`;
const Title = styled.div`
  font-weight: 500;
  font-size: 28px;
  line-height: 20px;
  text-align: center;
`;
const Body = styled.div`
  width: 340px;
  margin: 0px auto;
  letter-spacing: -0.6px;
`;
const InputArea = styled.div`
  margin-top: 30px;
`;
const InputWrapper = styled.div`
  margin-bottom: 12px;
`;

const FindUserInfoArea = styled.div`
  display: flex;
  justify-content: flex-end;
  margin-top: 10px;
  font-size: 13px;
  & p {
    color: rgb(51, 51, 51);
    font-size: 13px;
    letter-spacing: -0.6px;
  }

  & span {
    width: 1px;
    height: 10px;
    margin: 3px 6px 0px;
    background-color: rgb(51, 51, 51);
  }
`;
const BtnWrapper = styled.div`
  margin-top: 28px;
  position: relative;
  height: 48px;
`;
